public void write(char[] cbuf, int off, int len) throws IOException {
    int end = off+len;
    int writeBegin = off;

    for( int i=off; i<end; i++ ) {
        char ch = cbuf[i];
        if(!seenCR && ch==LF) {
            
            super.write(cbuf,writeBegin,i-writeBegin);
            super.write("\r\n");
            writeBegin=i+1;
        }
        seenCR = (ch==CR);
    }

    super.write(cbuf,writeBegin,end-writeBegin);
}

